offers.description:
Владею автомобилем с августа 2018 года. Первый владелец- юр. лицо (компания, в которой я работаю, не такси), второй владелец- мой знакомый из этой же компании. ПТС оригинал, есть ещё 1 место;
- Пробег не скручен, 80% пробега- трасса М4 Дон;
- Два комплекта ключей;
- Автомобиль технически обслужен, на данный момент никаких проблем нет: на 185 тысячах километров заменён ремень ГРМ вместе с приводными, отремонтированы щётки генератора, перебрана подвеска, заменён аккумулятор (Bosch). На 207 тысячах заменены передние тормозные диски, задние барабаны, колодки вкруг. На 220 тысячах заменено сцепление. Замена масла и фильтров раз в 10 тысяч километров, бензин только 95 на Лукойл и BP. Два комплекта резины: зима на шипах в нормальном состоянии (Michelin), лето в хорошем состоянии (Toyo);
- По кузову есть нюансы: передний бампер снизу с царапинами, задние левая и правая двери окрашены локально, есть сколы и места с рыжиками, небольшая вмятина на передней правой двери.
Осмотр в г. Ступино в любой день, на интересующие вопросы отвечу по телефону.
